import React from "react";
import ReactDelayRender from "react-delay-render";
import FadeIn from "react-fade-in";

import "./Projects.css";

const Projects = () => {
  return (
    <FadeIn>
      <div className="about__wrapper">
        <p className="about__paragraph">
          Here is a couple of projects from the very beginning of my coding
          Journey:
        </p>
        <Collapsible trigger="Hobbies/Interests">
          <p className="skills__paragraph">
            My main hobbies include weightlifting, video and board games,
            cooking and comedy of many sorts. Outside of web development, I am
            very passionate about nutritional science and evolutionary
            psychology. I am a member of British Mensa.
          </p>
        </Collapsible>
      </div>
    </FadeIn>
  );
};

export default ReactDelayRender({ delay: 401 })(Projects);
